			<section id="data" class="wrapper style2 special">
				<div class="container">

					<header class="major special">
						<h2>About the data</h2>
					
					</header>

				<p>Data for journeys made on the scheme can be accessed from <a href="https://s3.amazonaws.com/tripdata/index.html" target="_blank">Amazon web services</a>.
				Data is available for each month from July 2013. Each datafile contains information on: trip duration (including timestamps for trip start and end); start/end station (including station ID); bike ID; user type (i.e., annual subscriber or customer); gender; and year of birth. Learn more about Citi Bike by visiting its <a href="https://www.citibikenyc.com/" target="_blank">website</a>.</p>
				<p>Quarters in the above analyses are defined as: Q1 - January to March; Q2 - April to June; Q3 - July to September; Q4 - October to December. These are treated as analogies to winter, spring, summer and autumn, respectively.</p>
				<p>Analyses were carried out using the programming languages <a href="https://www.r-project.org/" target="_blank">R</a> and <a href="https://www.python.org/" target="_blank">Python</a>. Graphics were created using <a href="https://carto.com/" target="_blank">Carto</a>, <a href="http://ggplot2.org/" target="_blank">ggplot2</a>, and <a href="http://bokeh.pydata.org/en/latest/" target="_blank">Bokeh</a>.</p>
				</div>

